import React from 'react';
import './App.css';
import {Container, Flex, Grid, GridItem, SimpleGrid} from "@chakra-ui/react";
import Navbar from "./components/Navbar";
import LiveMatches from "./components/LiveMatches";
import UpcomingMatches from "./components/UpcomingMatches";
import EndedMatches from "./components/EndedMatches";
import CountryLeagues from "./components/CountryLeagues";

// Contains all the various components to make up the complete page/app

function App() {
  return (
    <Container bg='#030303' minHeight='100vh' minWidth='100%'>
      <header>
        <Navbar/>
      </header>

      <body className='App'>
      <CountryLeagues/>

      <Flex mt='20px' bg='#030303' minH='max-content'>
          <SimpleGrid columns={1} bg='#222222' minWidth='100%' borderRadius='10px'>
              <LiveMatches/>
              <UpcomingMatches/>
              <EndedMatches/>
          </SimpleGrid>

      </Flex>

      <Grid
          h='200px'
          templateRows='repeat(2, 1fr)'
          templateColumns='repeat(5, 1fr)'
          gap={4}
      >
          <GridItem rowSpan={2} colSpan={1} bg='tomato' />
          <GridItem colSpan={2} bg='papayawhip' />
          <GridItem colSpan={2} bg='papayawhip' />
          <GridItem colSpan={4} bg='tomato' />
      </Grid>


      </body>
    </Container>
  );
}
export default App;
